window.bookSummaryJSON = "<p><b>In the choking smog and steel of City Nineteen's slums, nature didn't seek a warriorâ€”it sought a crusader.</b></p> <p>For a young mycologist raised in the city's bleakest corners, life offers scant opportunities and even less justice. But destiny has chosen them to navigate treacherous union politics, decipher the mysteries of their birthplace, and unravel the enigma of a god-like master. Their goal? To mend the fractured bond between man and nature.</p> <p>Yet, as shadows deepen and they discover the depths of the city's rot, they begin to wonder: Is the only true remedy to set the world aflame and rise from its ashes?</p>"; 
